#!/bin/bash

NCURSES_SRC=$CACHE/ncurses

NCURSES_RPM_NAME=NCurses
NCURSESW_RPM_NAME=NCursesW
NCURSES_VERSION="6.5"
NCURSES_FULLNAME=$NCURSES_RPM_NAME-$NCURSES_VERSION
NCURSESW_FULLNAME=$NCURSESW_RPM_NAME-$NCURSES_VERSION
$ROOT/download_and_untar.sh "https://ftp.gnu.org/gnu/ncurses/ncurses-6.5.tar.gz" "$NCURSES_SRC"

if [ ! -d $NCURSES_SRC/build-tic ]
then
  mkdir -p $NCURSES_SRC/build-tic
  cd $NCURSES_SRC/build-tic
  ../configure --without-manpages --without-tests --without-debug
  make -j$(nproc) -C include
  make -j$(nproc) -C progs tic
fi

if [ ! -d $NCURSES_SRC/buildw ]
then
  mkdir -p $NCURSES_SRC/buildw
  cd $NCURSES_SRC/buildw
  ../configure --prefix=/usr \
                --build=$(../config.guess) \
                --host=$TARGET \
                --with-shared \
                --without-debug \
                --without-normal \
                --with-cxx-shared \
                --without-ada \
                --disable-stripping \
                --without-manpages \
                --without-tests
  make -j$(nproc)
fi

if [ ! -d $NCURSES_SRC/build ]
then
  mkdir -p $NCURSES_SRC/build
  cd $NCURSES_SRC/build
  ../configure --prefix=/usr \
                --build=$(../config.guess) \
                --host=$TARGET \
                --disable-widec \
                --with-shared \
                --without-debug \
                --without-normal \
                --with-cxx-shared \
                --without-ada \
                --disable-stripping \
                --without-manpages \
                --without-tests
  make -j $(nproc)
fi


